import { makeStyles } from "@mui/styles";

export const useStyles = makeStyles({
  footer:{
    display:'flex',
    width:'100%',
    justifyContent:'space-between',
    padding:'0 24px',
    marginTop:48
  },
  links:{
    display:'flex',
    float:'right',
    '& :last-child':{
      marginLeft:0
    }
  },
  bar:{
    display:'flex',
    marginLeft:96
  },
  firstColunm:{
    display:'flex',
  },
  secondColunm:{
    display:'flex',
    justifyContent:'space-between',
    flexDirection:'column'
  },
  barText:{
    marginBottom:10,
    fontSize:14,
    color:'#191919'
  },
  firstColunmBar:{
    marginRight:96,
    '& :last-child':{
      marginBottom:0
    }
  },
  secondColunmBar:{
    '& :last-child':{
      marginBottom:0
    }
  },
  link:{
    marginLeft:34
  }
})
